INSERT INTO `us_cybersecurity_laws` VALUES (1,'§ 1500. National Cyber Director','Compliance','§ 1500. National Cyber Director is a U.S. law that establishes the position of National Cyber Director within the Executive Office of the President. This individual is responsible for coordinating national cybersecurity policy and strategy, as well as advising the President and federal agencies on cyber-related matters. The law outlines the qualifications and duties of the National Cyber Director, emphasizing the importance of safeguarding the nation''s critical','"§ 1500. National Cyber Director." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1500','https://www.law.cornell.edu/uscode/text/6/1500'),(2,'§ 1501. Definitions','Compliance','Section 1501 of Title 6 of the United States Code provides definitions for terms used in the Homeland Security Act of 2002. This law establishes clear and specific meanings for key concepts relevant to national security and emergency preparedness efforts in the United States.','"§ 1501. Definitions." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1501','https://www.law.cornell.edu/uscode/text/6/1501'),(3,'§ 1502. Sharing of information by the Federal Government','Compliance','Section 1502 of the U.S. Code mandates the sharing of information by the Federal Government to enhance the security and resilience of critical infrastructure. This law promotes collaboration between government agencies and private sector entities to protect against cybersecurity threats and ensure the continuity of essential services.','"§ 1502. Sharing of information by the Federal Government." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1502','https://www.law.cornell.edu/uscode/text/6/1502'),(4,'§ 1503. Authorizations for preventing, detecting, analyzing, and mitigating cybersecurity threats','Compliance','§ 1503 of the U.S. Code authorizes the Department of Homeland Security to prevent, detect, analyze, and mitigate cybersecurity threats. This law allows the Department to take necessary measures to protect critical infrastructure and respond to cyber incidents that threaten national security. It outlines the powers and responsibilities of the Department in addressing cyber threats to ensure the security and resilience of the nation''s cyber infrastructure.','"§ 1503. Authorizations for preventing, detecting, analyzing, and mitigating cybersecurity threats." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1503','https://www.law.cornell.edu/uscode/text/6/1503'),(5,'§ 1504. Sharing of cyber threat indicators and defensive measures with the Federal Government','Compliance','§ 1504 requires private entities to share cyber threat indicators and defensive measures with the Federal Government in order to enhance cybersecurity protections and facilitate the exchange of critical information to prevent and respond to cyber attacks.','"§ 1504. Sharing of cyber threat indicators and defensive measures with the Federal Government." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1504','https://www.law.cornell.edu/uscode/text/6/1504'),(6,'§ 1505. Protection from liability','Compliance','Title 6, Section 1505 of the U.S. Code provides protection from liability for individuals who report suspicious activity related to terrorism to the appropriate authorities. This law shields individuals from civil liability for making such reports in good faith, encouraging the public to be vigilant and proactive in preventing potential threats to national security.','"§ 1505. Protection from liability." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1505','https://www.law.cornell.edu/uscode/text/6/1505'),(7,'§ 1506. Oversight of government activities','Compliance','Section 1506 of Title 6 of the U.S. Code outlines the responsibilities and authorities of the Inspector General of the Department of Homeland Security in overseeing government activities. This law ensures transparency, accountability, and efficiency in the operations of government agencies to prevent fraud, waste, and abuse of taxpayer funds. The Inspector General is authorized to conduct audits, investigations, and evaluations to ensure compliance with laws and','"§ 1506. Oversight of government activities." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1506','https://www.law.cornell.edu/uscode/text/6/1506'),(8,'§ 1507. Construction and preemption','Compliance','Section 1507 of Title 6 of the U.S. Code outlines the rules regarding the construction and preemption of laws relating to homeland security. It establishes that this law does not affect the powers of states or local governments to enforce their own laws, unless they conflict with federal law. Additionally, it specifies that federal laws preempt state or local laws that are inconsistent with or obstruct the purposes of federal','"§ 1507. Construction and preemption." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1507','https://www.law.cornell.edu/uscode/text/6/1507'),(9,'§ 1508. Report on cybersecurity threats','Compliance','§ 1508. Report on cybersecurity threats requires the Secretary of Homeland Security to submit an annual report to Congress detailing significant cybersecurity threats to the United States. The report must include information on current and emerging threats, vulnerabilities, and incidents, as well as recommendations for improving cybersecurity efforts. This law aims to enhance national security by keeping policymakers informed about the evolving landscape of cyber threats.','"§ 1508. Report on cybersecurity threats." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1508','https://www.law.cornell.edu/uscode/text/6/1508'),(10,'§ 1509. Exception to limitation on authority of Secretary of Defense to disseminate certain information','Compliance','Section 1509 of Title 6 of the U.S. Code provides an exception to the limitation on the Secretary of Defense''s authority to disseminate certain information. This law allows the Secretary of Defense to disclose classified information to federal, state, local, and tribal government officials for the purpose of protecting the nation''s security and critical infrastructure.','"§ 1509. Exception to limitation on authority of Secretary of Defense to disseminate certain information." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1509','https://www.law.cornell.edu/uscode/text/6/1509'),(11,'§ 1510. Effective period','Compliance','Section 1510 of the U.S. Code specifies the effective period of certain regulations related to the transportation security of hazardous materials. It outlines the duration of these regulations and provides clarity on when they are applicable and when they expire.','"§ 1510. Effective period." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1510','https://www.law.cornell.edu/uscode/text/6/1510'),(12,'§ 1521. Definitions','Compliance','§ 1521. Definitions is a section of the United States Code that provides specific definitions for terms used in the Homeland Security Act of 2002. This law clarifies the meanings of key terms related to homeland security and emergency preparedness, ensuring consistency and accuracy in interpretation and enforcement of the Act.','"§ 1521. Definitions." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1521','https://www.law.cornell.edu/uscode/text/6/1521'),(13,'§ 1522. Advanced internal defenses','Compliance','§ 1522. Advanced internal defenses is a U.S. law that authorizes the Secretary of Homeland Security to establish and maintain advanced internal defenses for protecting federal property and personnel against terrorist attacks. This law allows for the deployment of security measures, technologies, and personnel to enhance security and prevent potential threats.','"§ 1522. Advanced internal defenses." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1522','https://www.law.cornell.edu/uscode/text/6/1522'),(14,'§ 1523. Federal cybersecurity requirements','Compliance','§ 1523. Federal cybersecurity requirements is a U.S. law that outlines the cybersecurity requirements for federal agencies. It mandates the implementation of measures to protect federal information and systems from cyber threats, ensuring the confidentiality, integrity, and availability of critical data. The law also requires federal agencies to comply with cybersecurity standards and guidelines established by the Department of Homeland Security.','"§ 1523. Federal cybersecurity requirements." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1523','https://www.law.cornell.edu/uscode/text/6/1523'),(15,'§ 1524. Assessment; reports','Compliance','Section 1524 of Title 6 of the U.S. Code requires the Secretary of Homeland Security to assess the nation''s vulnerabilities to terrorism and submit reports to Congress on these assessments. The law aims to enhance national security by identifying potential threats and recommending measures to mitigate them.','"§ 1524. Assessment; reports." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1524','https://www.law.cornell.edu/uscode/text/6/1524'),(16,'§ 1525. Termination','Compliance','The U.S. law titled ''§ 1525. Termination'' outlines the procedures and requirements for terminating federal assistance to a state or local government that fails to comply with homeland security grant requirements. The law specifies the process for notifying the non-compliant government entity, providing an opportunity for corrective action, and ultimately terminating funding if compliance is not achieved.','"§ 1525. Termination." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1525','https://www.law.cornell.edu/uscode/text/6/1525'),(17,'§ 1526. Inventory of cryptographic systems; migration to post-quantum cryptography','Compliance','§ 1526 requires the Department of Homeland Security to maintain an inventory of all cryptographic systems used by the federal government. It also mandates the migration to post-quantum cryptography to ensure the security of these systems against potential threats from quantum computers.','"§ 1526. Inventory of cryptographic systems; migration to post-quantum cryptography." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1526','https://www.law.cornell.edu/uscode/text/6/1526'),(18,'§ 1531. Apprehension and prosecution of international cyber criminals','Compliance','§ 1531 of the U.S. Code addresses the apprehension and prosecution of international cyber criminals. This law allows for the investigation, arrest, and trial of individuals who commit cyber crimes that have a significant impact on U.S. national security and critical infrastructure. It provides legal authority for law enforcement agencies to collaborate with international partners to track down and bring to justice those responsible for cyber attacks.','"§ 1531. Apprehension and prosecution of international cyber criminals." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1531','https://www.law.cornell.edu/uscode/text/6/1531'),(19,'§ 1532. Enhancement of emergency services','Compliance','The U.S. law titled ''§ 1532. Enhancement of emergency services'' focuses on improving and strengthening emergency services in the country. It aims to enhance coordination, communication, and response capabilities among federal, state, local, tribal, and territorial agencies during emergencies and disasters. The law emphasizes the importance of preparedness, training, and mutual aid agreements to effectively respond to various emergency situations.','"§ 1532. Enhancement of emergency services." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1532','https://www.law.cornell.edu/uscode/text/6/1532'),(20,'§ 1533. Improving cybersecurity in the health care industry','Compliance','U.S. law § 1533 aims to enhance cybersecurity measures within the health care industry to protect sensitive patient information and ensure data privacy. This law mandates the implementation of robust cybersecurity protocols and practices to safeguard health care systems and prevent cyber attacks and data breaches.','"§ 1533. Improving cybersecurity in the health care industry." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1533','https://www.law.cornell.edu/uscode/text/6/1533'),(21,'§ 1534. Cybercrime','Compliance','§ 1534. Cybercrime is a U.S. law that addresses criminal activities related to computers and the internet. It prohibits unauthorized access to computer systems, theft of data, and other cybercrimes that pose a threat to national security and public safety. The law imposes penalties for individuals and organizations found guilty of engaging in cybercriminal activities.','"§ 1534. Cybercrime." Cornell Law School, https://www.law.cornell.edu/uscode/text/6/1534','https://www.law.cornell.edu/uscode/text/6/1534'),(22,'§ 6801. Protection of nonpublic personal information','Compliance','§ 6801. Protection of nonpublic personal information is a U.S. law that requires financial institutions to implement safeguards to protect the confidentiality and security of nonpublic personal information of their customers. This law outlines the requirements for the collection, disclosure, and protection of sensitive information, such as social security numbers and financial records, to prevent unauthorized access and disclosure.','"§ 6801. Protection of nonpublic personal information." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6801','https://www.law.cornell.edu/uscode/text/15/6801'),(23,'§ 6802. Obligations with respect to disclosures of personal information','Compliance','Section 6802 of Title 15 of the U.S. Code, known as ''Obligations with respect to disclosures of personal information'', outlines the requirements for financial institutions to disclose their privacy policies to customers and safeguard their personal information. This law aims to protect consumers'' sensitive data by setting standards for how financial institutions collect, use, and share personal information.','"§ 6802. Obligations with respect to disclosures of personal information." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6802','https://www.law.cornell.edu/uscode/text/15/6802'),(24,'§ 6803. Disclosure of institution privacy policy','Compliance','§ 6803 requires financial institutions to provide customers with a clear and accurate privacy policy outlining how their personal information is collected, shared, and protected. Customers must be informed of their rights to opt out of certain data sharing practices.','"§ 6803. Disclosure of institution privacy policy." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6803','https://www.law.cornell.edu/uscode/text/15/6803'),(25,'§ 6804. Rulemaking','Compliance','§ 6804. Rulemaking is a U.S. law that outlines the process for rulemaking by the Federal Trade Commission (FTC) in regards to regulations for the Telephone Disclosure and Dispute Resolution Act. This law requires the FTC to provide notice and opportunity for public comment before issuing rules related to the Act.','"§ 6804. Rulemaking." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6804','https://www.law.cornell.edu/uscode/text/15/6804'),(26,'§ 6805. Enforcement','Compliance','§ 6805. Enforcement is a U.S. law that outlines the enforcement mechanisms for violations of the provisions related to consumer protection and privacy under the Electronic Fund Transfer Act. This law empowers federal and state agencies to take action against entities that fail to comply with the requirements outlined in the Act, including imposing civil penalties and seeking injunctive relief. It also establishes procedures for investigating potential violations','"§ 6805. Enforcement." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6805','https://www.law.cornell.edu/uscode/text/15/6805'),(27,'§ 6806. Relation to other provisions','Compliance','Section 6806 of Title 15 of the U.S. Code clarifies that the provisions outlined in the Electronic Fund Transfer Act do not supersede or limit any other laws or regulations that provide greater protection to consumers. This section ensures that consumers retain all existing rights and protections afforded to them under other laws in addition to those provided by the Electronic Fund Transfer Act.','"§ 6806. Relation to other provisions." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6806','https://www.law.cornell.edu/uscode/text/15/6806'),(28,'§ 6807. Relation to State laws','Compliance','Section 6807 of Title 15 of the U.S. Code, also known as ''Relation to State laws'', states that the provisions of the Electronic Fund Transfer Act (EFTA) do not preempt any state law that is consistent with the EFTA and provides greater protection to consumers. This means that states are allowed to enact laws that offer additional safeguards for consumers in electronic fund transfer transactions, as','"§ 6807. Relation to State laws." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6807','https://www.law.cornell.edu/uscode/text/15/6807'),(29,'§ 6808. Study of information sharing among financial affiliates','Compliance','§ 6808 is a U.S. law that requires the Director of the Bureau of Consumer Financial Protection to conduct a study on information sharing practices among financial affiliates. The study aims to assess the impact of these practices on consumers and provide recommendations for improving transparency and protecting consumer privacy.','"§ 6808. Study of information sharing among financial affiliates." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6808','https://www.law.cornell.edu/uscode/text/15/6808'),(30,'§ 6809. Definitions','Compliance','§ 6809. Definitions is a U.S. law that provides specific definitions for terms used in the Electronic Fund Transfer Act, including terms such as "electronic fund transfer," "financial institution," and "unauthorized electronic fund transfer." This law helps clarify and standardize terminology related to electronic fund transfers to ensure consistency and understanding among financial institutions and consumers.','"§ 6809. Definitions." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6809','https://www.law.cornell.edu/uscode/text/15/6809'),(31,'§ 6821. Privacy protection for customer information of financial institutions','Compliance','§ 6821 of Title 15 of the U.S. Code, also known as the Gramm-Leach-Bliley Act, requires financial institutions to establish safeguards to protect the privacy and security of customer information. This law sets standards for the collection, use, and disclosure of personal information by financial institutions to ensure the confidentiality and integrity of customer data. Financial institutions must provide customers with notices of','"§ 6821. Privacy protection for customer information of financial institutions." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6821','https://www.law.cornell.edu/uscode/text/15/6821'),(32,'§ 6822. Administrative enforcement','Compliance','Section 6822 of the U.S. Code outlines the administrative enforcement procedures for violations of the Energy Policy Act of 2005. This law grants authority to the Federal Trade Commission and the Secretary of Energy to enforce compliance with energy efficiency standards and labeling requirements for consumer products. The law allows for investigations, inspections, and penalties for non-compliance, with the goal of promoting energy conservation and consumer protection','"§ 6822. Administrative enforcement." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6822','https://www.law.cornell.edu/uscode/text/15/6822'),(33,'§ 6823. Criminal penalty','Compliance','§ 6823. Criminal penalty is a U.S. law that imposes penalties for violations of the Consumer Product Safety Act, including fines and imprisonment for individuals found guilty of knowingly making false statements or withholding information from the Consumer Product Safety Commission.','"§ 6823. Criminal penalty." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6823','https://www.law.cornell.edu/uscode/text/15/6823'),(34,'§ 6824. Relation to State laws','Compliance','The U.S. law titled ''§ 6824. Relation to State laws'' establishes that federal regulations related to the labeling and advertising of organic products preempt any state laws that are less stringent. This law ensures consistency and compliance with national organic standards across all states.','"§ 6824. Relation to State laws." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6824','https://www.law.cornell.edu/uscode/text/15/6824'),(35,'§ 6825. Agency guidance','Compliance','§ 6825. Agency guidance is a U.S. law that outlines the requirements for federal agencies to provide guidance to regulated entities and the public. This law ensures that agency guidance is clear, accessible, and consistent with existing laws and regulations. It also requires agencies to make guidance documents readily available to the public and to seek public input when developing new guidance.','"§ 6825. Agency guidance." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6825','https://www.law.cornell.edu/uscode/text/15/6825'),(36,'§ 6826. Reports','Compliance','Section 6826 of Title 15 of the U.S. Code requires the Federal Trade Commission to submit an annual report to Congress detailing its activities related to enforcing consumer protection laws. The report must include information on investigations, enforcement actions, and other relevant activities undertaken by the FTC to protect consumers from unfair or deceptive practices in the marketplace.','"§ 6826. Reports." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6826','https://www.law.cornell.edu/uscode/text/15/6826'),(37,'§ 6827. Definitions','Compliance','§ 6827. Definitions is a U.S. law that provides clear and specific definitions for key terms used in the Federal Trade Commission Act, particularly in relation to consumer protection and antitrust laws. This section helps to ensure consistent interpretation and application of the law by defining important terms such as "unfair or deceptive acts or practices" and "unfair methods of competition".','"§ 6827. Definitions." Cornell Law School, https://www.law.cornell.edu/uscode/text/15/6827','https://www.law.cornell.edu/uscode/text/15/6827');

/*(1,'Health Insurance Portability and Accountability Act (HIPAA)','Compliance','HIPAA mandates data privacy and security provisions for safeguarding medical information.','\"Health Insurance Portability and Accountability Act.\" U.S. Department of Health & Human Services, www.hhs.gov/hipaa/index.html.','https://www.hhs.gov/hipaa/index.html'),(2,'California Consumer Privacy Act (CCPA)','Data Privacy','CCPA grants California residents new rights regarding their personal information and imposes data protection responsibilities on businesses.','\"California Consumer Privacy Act.\" State of California - Department of Justice, oag.ca.gov/privacy/ccpa.','https://oag.ca.gov/privacy/ccpa'),(3,'Computer Fraud and Abuse Act (CFAA)','Cybercrime Consequences','CFAA criminalizes unauthorized access to computer systems and has been used in various cybercrime prosecutions.','\"Computer Fraud and Abuse Act.\" Legal Information Institute, Cornell Law School, www.law.cornell.edu/uscode/text/18/1030.','https://www.law.cornell.edu/uscode/text/18/1030');
